import React from 'react';
import Home from './views/Home/Home';
import Landing from './views/Landing/Landing';
import { Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Route>
        <Landing></Landing>
      </Route>
      <Route>
        <Home></Home>
      </Route>
    </div>
  );
}

export default App;
